import React from 'react';
import logo from '../../img/puma-logo.svg';
import Menu from './../Menu/Menu';
import './app.sass';

const menu = [
    {
        text: 'Studio'
    },
    {
        text: 'Partners'
    },
    {
        text: 'Media'
    },
    {
        text: 'user'
    }
]

function App() {
		return (
			<div className="main">
				<header className="menu">
					<img src={logo} className="App-logo" alt="logo" />
					<ul>
						<Menu items={menu} />
					</ul>
				</header>
			</div>
		);
	}

export default App;
